import React from "react";
import ReactDOM from "react-dom";
import Provider from './store/store'

import App from "./App";

const rootElement = document.getElementById("root");
ReactDOM.render(
  <React.StrictMode>
    <Provider>
      <App />
    </Provider> 
  </React.StrictMode>,
  rootElement
);
